-- ----------------------------
-- Table structure for `merchant`
-- ----------------------------
DROP TABLE IF EXISTS `merchant`;
CREATE TABLE `merchant` (
`id`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商户id' ,
`merchant_code`  char(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商户编码' ,
`merchant_shopname`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '店铺名称' ,
`merchant_type_id`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商户类别id' ,
`merchant_content_id`  varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '服务内容id，多个用,(逗号)隔开' ,
`merchant_level`  int(11) NULL DEFAULT NULL COMMENT '用户等级' ,
`merchant_censor_status`  tinyint(1) NULL DEFAULT NULL COMMENT '审核通过1 提交2  审核不通过3  停止合作4  违规5  违法6' ,
`merchant_province`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省' ,
`merchant_city`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '市' ,
`merchant_scenic_spot`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '景区' ,
`merchant_address`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地址' ,
`merchant_business_licence`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '营业执照url' ,
`merchant_id_card_up`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '法人身份证正面url' ,
`merchant_id_card_down`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '法人身份证反面url' ,
`merchant_divide_up_rule`  tinyint(1) NULL DEFAULT NULL COMMENT '分成规则 1代表比例、2代表固定金额' ,
`merchant_balance`  decimal(10,2) NOT NULL ,
`merchant_qr_code`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '二维码' ,
`merchant_operating_spring`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-春天' ,
`merchant_operating_summer`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-夏天' ,
`merchant_operating_autumn`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-秋天' ,
`merchant_operating_winter`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-冬天' ,
`merchant_operating_mon`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-周一' ,
`merchant_operating_tue`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-周二' ,
`merchant_operating_wed`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-周三' ,
`merchant_operating_thu`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-周四' ,
`merchant_operating_fri`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-周五' ,
`merchant_operating_sat`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-周六' ,
`merchant_operating_sun`  tinyint(1) NULL DEFAULT NULL COMMENT '营业季节-周日' ,
`merchant_operating_start`  datetime NULL DEFAULT NULL COMMENT '营业时间-开始' ,
`merchant_operating_end`  datetime NULL DEFAULT NULL COMMENT '营业时间-结束' ,
`merchant_description`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '描述信息' ,
`create_user_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`create_time`  datetime NULL DEFAULT 'CURRENT_TIMESTAMP' ,
`update_user_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`update_time`  datetime NULL DEFAULT NULL ,
`merchant_delflag`  tinyint(1) NULL DEFAULT NULL COMMENT '删除标记：0-删除，1-有效，创建时为1' ,
`merchant_user_id`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`change_description`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`merchant_contact_name`  varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`merchant_contact_mobile`  varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`merchant_icon`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
PRIMARY KEY (`id`),
UNIQUE INDEX `merchant_code` (`merchant_code`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci

;

