DROP TABLE IF EXISTS `message`;
CREATE TABLE `message` (
`id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`message_type`  tinyint(1) NULL DEFAULT NULL COMMENT '0代表公告，1代表活动消息，2代表服务消息' ,
`message_title`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`message_content`  varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`message_publish_time`  datetime NULL DEFAULT NULL ,
`message_cancel_time`  datetime NULL DEFAULT NULL ,
`delflag`  tinyint(1) NULL DEFAULT NULL COMMENT '0删除      1正常' ,
`message_merchant_id`  mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL ,
`create_user_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`create_time`  datetime NULL DEFAULT 'CURRENT_TIMESTAMP' ,
`update_user_id`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`update_time`  datetime NULL DEFAULT NULL ,
`message_promotion_id`  char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`message_img`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`message_immediately_push`  tinyint(1) NULL DEFAULT NULL ,
`message_receive_all`  tinyint(1) NULL DEFAULT NULL ,
`message_is_push`  tinyint(1) NULL DEFAULT NULL ,
`message_is_sms`  tinyint(1) NULL DEFAULT NULL ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci

